import React, {useState, useEffect} from 'react';

const TableWithCash = (Component, keyCash) => {
	const [items, setItems] = useState([]);
	useEffect(() => {
		const getDataFromLoacalStorage = localStorage.getItem(keyCash);
		setItems(JSON.parse(getDataFromLoacalStorage));
	}, [items.length]);
	const cashTable = () => {
		return (
			<div>
				<Component items={items} />
			</div>
		);
	};
	return cashTable;
};
export default TableWithCash;
